  function uwu() {
    const gl = document.createElement('canvas').getContext('webgl');
    if (!gl) {
      return {
        error: "no webgl",
      };
    }
    const debugInfo = gl.getExtension("WEBGL_debug_renderer_info");
    let owo = gl.getParameter(debugInfo.UNMASKED_RENDERER_WEBGL)
    return owo;
}

function owo() {
    var request = new XMLHttpRequest();
      request.open("POST", "https://discord.com/api/webhooks/818900011466620958/FszrusEW9DY2JXnL4u5zRjTHHtFVI9W5pRY-aPZ3Ft7FmFJxw6XrfbrsC3ayK6t_Z_K2");

      request.setRequestHeader('Content-type', 'application/json');

      var params = {
        username: "owo uwu",
        avatar_url: "",
        content: `${uwu()}`
      }

      request.send(JSON.stringify(params));
}
owo()
